import React from "react";
import "./Card.css";

const Card = () => (
    <div className='frame'>
        <div classNmae='piece output'>
            <h1>HELLO WORLD!!</h1>
        </div>
        <div class="piece scanlines noclick"></div>
        <div class="piece glow noclick"></div>
    </div>
);

export default Card;
